package com.zhijianlife.core.model;import java.io.Serializable;@SuppressWarnings("serial")public class UserSeller implements Serializable{	private String address;	private Double courierFees;	private String email;	private String info;	private Double minPrice;	private String phone;	private String pic;	private String shopName;	private int userId;	private String userName;	private int bad;	private int good;	private int normal;	public String getAddress() {		return address;	}	public void setAddress(String address) {		this.address = address;	}	public Double getCourierFees() {		return courierFees;	}	public void setCourierFees(Double courierFees) {		this.courierFees = courierFees;	}	public String getEmail() {		return email;	}	public void setEmail(String email) {		this.email = email;	}	public String getInfo() {		return info;	}	public void setInfo(String info) {		this.info = info;	}	public Double getMinPrice() {		return minPrice;	}	public void setMinPrice(Double minPrice) {		this.minPrice = minPrice;	}	public String getPhone() {		return phone;	}	public void setPhone(String phone) {		this.phone = phone;	}	public String getPic() {		return pic;	}	public void setPic(String pic) {		this.pic = pic;	}	public String getShopName() {		return shopName;	}	public void setShopName(String shopName) {		this.shopName = shopName;	}	public int getUserId() {		return userId;	}	public void setUserId(int userId) {		this.userId = userId;	}	public String getUserName() {		return userName;	}	public void setUserName(String userName) {		this.userName = userName;	}	public int getBad() {		return bad;	}	public void setBad(int bad) {		this.bad = bad;	}	public int getGood() {		return good;	}	public void setGood(int good) {		this.good = good;	}	public int getNormal() {		return normal;	}	public void setNormal(int normal) {		this.normal = normal;	}}